      "snippet": {
        "publishedAt": "2020-02-19T16:43:24Z",
        "channelId": "UCqyZMlq1g_IPez-weFh6-xA",
        "title": "5500ft Snowboarding Descent in Alpe d'Huez - Chasing Andy in 4k",
        "description": "Headcam footage of me snowboarding down one of the longest runs here in Alpe d'Huez. 5500 feet of descent. This is one of my favourite routes, it begins at the 'Dome des Rousses' and then starts on the red piste 'le Belvedère' before taking a right onto the red run 'Bartavelles'. This is one of my favourite runs in Alpe d'Huez, it has a great consistent pitch as well as some nice bends which gives it the feel of a boardercross track. Afterwards it joins onto 'les Rousses' and then blue run 'Chalets'. From here it is then onto the black piste 'La Fare'. This was a bit icy as it hasn't been getting that much snow lower down this season. I give Andy a 3 minute head startbut can I catch him?\n\nLet me know if you came to this video by searching for relaxing ASMR sounds. ASMR wasn't something I knew anything aboutbut I've had alot of people come across this video because of it!\n\nShot on a GoPro Hero 8 Black in 4k\n\nIf you would like to have snowboard lessons with me here in Alpe d'Huez, France, then take a look at my website below to find out more:\n\nhttps://masterclasssnowboarding.com/\nhttps://www.instagram.com/malcolmmooresnowboarding/\n\nTo support the channel - PayPal Tip Jar: https://www.paypal.com/paypalme/malcolmmoore0301\nOr Just go through this link next time you use Booking.com and I'll get 2% comission on your holiday cost instead of them!\nhttps://www.booking.com/index.html?aid=7943142\n\nI'm Riding Amplid Boards: http://amplid.com/?sPartner=MalcolmM\n\nIf you're in the UK or Europe, I recommend this shop for buying snowboarding equipment, it costs you nothing but helps me out!\n\nBlue Tomato - https://pn.blue-tomato.com/go.cgi?pid=119&wmid=cc&cpid=1&target=https://www.blue-tomato.com/en-GB/products/categories/Snowboard+Shop-00000000/%3Fcampaign%3Dinternaffiliates%2Fall%2Flinkgenerator%26utm_campaign%3DAll/QualityClick%26ia-pkpmtrack=100-4333136313236323131303-101-162-101\n\nCheck out my new Snowboarding Outerwear here: https://bit.ly/3bu56Rc\n\n360 Camera - https://www.insta360.com/sal/one_x2?insrc=INRUQU3\nAction Camera - https://www.insta360.com/sal/one_r?insrc=INRUQU3\n\nFor Goggles and Sunnies I wear - https://sungod.to/PuTYQNDX/\n\nThanks for watching, please like and subscribe if you enjoyed the video!",
